---
--- create tables
---

CREATE TABLE Hospitals (
	hospital_id INT,
	hospital_name VARCHAR(50),
	hospital_address VARCHAR(80),
	town VARCHAR(50),
	hospital_status VARCHAR(50)
);
CREATE TABLE ambulance(
ambulance_id INT,
hospital_id INT  
);


CREATE TABLE driver(
driver_id INT,
driver_f_name varchar(50),
driver_l_name varchar(50),
ambulance_id INT
);


CREATE TABLE Specialization (
	specialization_id INT,
	spzltn_name VARCHAR(50)
);
CREATE TABLE Doctor (
	doctor_id INT,
	dc_f_name VARCHAR(50),
	dc_l_name VARCHAR(50),
	dc_gender VARCHAR(50),
	dc_bith_of_date DATE,
	hospital_id INT,
	splztn_id INT 
);

CREATE TABLE medicaments (
	medicament_id INT,
	medicament_name VARCHAR(50)
);

CREATE TABLE hospital_medicaments (
	hospital_id INT,
	medicament_id INT
);

CREATE TABLE Bill (
	bill_id INT,
	bill_price INT
);


CREATE TABLE Disease (
	disease_id INT,
	disease_name VARCHAR(50)
);

CREATE TABLE Patient (
	patient_id INT,
	ptn_f_name VARCHAR(50),
	ptn_l_name VARCHAR(50),
	ptn_gender VARCHAR(50)
);

CREATE TABLE appointment (
	appointment_id INT,
	doctor_id INT ,
	patient_id INT ,
	disease_id INT,
	appointment_date DATE,
	bill_id INT 
);
