-- PRIMARY KEYS -

ALTER TABLE ONLY appointment ADD CONSTRAINT pk_appointment PRIMARY KEY (appointment_id);
ALTER TABLE ONLY Hospitals ADD CONSTRAINT pk_Hospitals PRIMARY KEY (hospital_id);
ALTER TABLE ONLY ambulance ADD CONSTRAINT pk_ambulance PRIMARY KEY (ambulance_id);
ALTER TABLE ONLY driver ADD CONSTRAINT pk_driver PRIMARY KEY (driver_id);
ALTER TABLE ONLY Specialization ADD CONSTRAINT pk_Specialization PRIMARY KEY (specialization_id);
ALTER TABLE ONLY Doctor ADD CONSTRAINT pk_doctor PRIMARY KEY (doctor_id);
ALTER TABLE ONLY medicaments ADD CONSTRAINT pk_medicaments PRIMARY KEY (medicament_id);
ALTER TABLE ONLY Bill ADD CONSTRAINT pk_bill PRIMARY KEY (bill_id);
ALTER TABLE ONLY Disease ADD CONSTRAINT pk_Disease PRIMARY KEY (disease_id);
ALTER TABLE ONLY Patient ADD CONSTRAINT pk_patient PRIMARY KEY (patient_id);


-- FOREIGN KEYS -

ALTER TABLE ONLY ambulance ADD CONSTRAINT fk_ambulance_hospitals FOREIGN KEY (hospital_id) REFERENCES hospitals;
ALTER TABLE ONLY driver ADD CONSTRAINT fk_driver_ambulance FOREIGN KEY (ambulance_id) REFERENCES ambulance;
ALTER TABLE ONLY Doctor ADD CONSTRAINT fk_Doctor_hospitals FOREIGN KEY (hospital_id) REFERENCES hospitals;
ALTER TABLE ONLY Doctor ADD CONSTRAINT fk_Doctor_specialization FOREIGN KEY (splztn_id) REFERENCES specialization;
ALTER TABLE ONLY hospital_medicaments ADD CONSTRAINT fk_hospital_medicaments_hospitals FOREIGN KEY (hospital_id) REFERENCES hospitals;
ALTER TABLE ONLY hospital_medicaments ADD CONSTRAINT fk_hospital_medicaments_medicaments FOREIGN KEY (medicament_id) REFERENCES medicaments;
ALTER TABLE ONLY appointment ADD CONSTRAINT fk_appointment_doctor FOREIGN KEY (doctor_id) REFERENCES  doctor;
ALTER TABLE ONLY appointment ADD CONSTRAINT fk_appointment_patient FOREIGN KEY (patient_id) REFERENCES patient;
ALTER TABLE ONLY appointment ADD CONSTRAINT fk_appointment_disease FOREIGN KEY (disease_id) REFERENCES disease;
ALTER TABLE ONLY appointment ADD CONSTRAINT fk_appointment_bill FOREIGN KEY (bill_id) REFERENCES bill;
